import React from 'react';
import {
    Text,
    View,
    Image,
} from 'react-native';
import styles from '../styles/MenuBar.style';
import {
    MENU,
    MENU_WHITE,
} from '../constants/Images';
import MenuIconWhite from './MenuIconWhite';
import MenuIconBlack from './MenuIconBlack';
import MenuItem from './MenuItem';

class MenuBar extends React.Component {
    constructor() {
        super();
        const state = {
        };
    }

    componentDidMount() {
        //add stuff
    }

    render() {
        return (
            <View style={styles.container}>
                <View style={styles.menuIconContainer}>
                    <MenuIconBlack />
                </View>
                <View style={styles.menuContentContainer}>
                    <MenuItem props={'HOME'}/>
                    <View style={styles.menuContentItem}>
                        <Text style={styles.menuContentItemText}>ABOUT ME</Text>
                    </View>
                    <View style={styles.menuContentItem}>
                        <Text style={styles.menuContentItemText}>PROJECTS</Text>
                    </View>
                    <View style={styles.menuContentItem}>
                        <Text style={styles.menuContentItemText}>WORK HISTORY</Text>
                    </View>
                </View>
            </View>
        );
    }
}

export default MenuBar;
